import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import ReservationForm from './components/ReservationForm';
import Reservations from './pages/Reservations';
import ReservationDetail from './pages/ReservationDetail';
import Factures from './pages/Factures';
import Success from './pages/Success'; // si tu veux rediriger après paiement
import Annulation from './pages/Annulation';



function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<ReservationForm />} />
        <Route path="/reservations" element={<Reservations />} />
        <Route path="/reservation/:id" element={<ReservationDetail />} />
        <Route path="/factures" element={<Factures />} />
        <Route path="/success" element={<Success />} />
        <Route path="/annulation/:id/:date" element={<Annulation />} />
        <Route path="/reservation-edit/:id" element={<ReservationEdit />} />


      </Routes>
    </BrowserRouter>
  );
}

export default App;
